  Widget customRoundedButton({required String msg,required int index,required BuildContext context}){

    return Padding(
      padding: const EdgeInsets.all(8.0),
      child: InkWell(
        onTap: (){
          Navigator.push(
            context,
            MaterialPageRoute(builder: (context) => LoginScreen(index:index)),
          );
        },
        child: Row(
          children: [
            Container(
              height: 60,
              width: 10,
              decoration: const BoxDecoration(
                  color: Color(0XFF1A1B37)
              ),
            ),
            Container(
              height: 60,
              alignment: Alignment.centerLeft,
              constraints: const BoxConstraints(
                minWidth: 120
              ),
              padding: const EdgeInsets.symmetric(vertical: 10,horizontal: 20),
              decoration:  BoxDecoration(
               borderRadius: const BorderRadius.only(
                    topRight: Radius.circular(50),
                    bottomRight: Radius.circular(50),
                  ),
                  border: Border.all(color: Colors.white),
                 color: index==0?const Color(0XFFE6D5FF):(index==1?const Color(0XFFFFDEAB):const Color(0XFFE6D5FF))
                 /* gradient: const LinearGradient(
                      colors: [
                        Color(0XFF2D01AD),
                        Color(0XFF6A33FB),
                      ]
                  )*/
              ),
              child: CustomTextWidget(txt: msg.toUpperCase(),clr: const Color(0XFF1A1B37),fontSize: 20,weight: FontWeight.bold,),
            ),
          ],
        ),
      ),
    );
  }
